  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0104374 includes chemical,
  optical and other data collected aboard the THOMAS G. THOMPSON during cruise TN282
  in the Coastal Waters of SE Alaska and North Pacific Ocean from 2012-03-11 to 2012-07-06.
  These data include Attenuation/Transmission, CONDUCTIVITY, CURRENT SPEED - EAST/WEST
  COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), DEPTH - BOTTOM, DEPTH
  - OBSERVATION, DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE, SALINITY and
  WATER TEMPERATURE. The instruments used to collect these data include ADCP, CTD,
  GPS, echo sounder, fluorometer, oxygen meter and transmissometer. These data were
  collected by Dwight Owens of Unknown, Keith Shepherd of Unknown, Kim Wallace of
  Unknown, Jason Williams of Unknown, Reuben Mills of Unknown, Marjolaine Matabos
  of Unknown, Raymond Morgan of Unknown, Andrew Robertson of Unknown, Barry Brake
  of Unknown, Alice Bui of Unknown, Christopher Carpenter of Unknown, Joshua Chernov
  of Unknown, Karen Doehler of Unknown, John Dower of Unknown, Leslie Elliott of Unknown,
  Stephen Farrington of Unknown, Tania Insua of Unknown, Reyna Jenkyns of Unknown,
  Ian Kulin of Unknown, Oyvind Lundesgaard of Unknown, Jonathon Miller of Unknown,
  Garrett Mitchell of Unknown, James Newman of Unknown, Nicholas Scott of Unknown,
  Alexandra Spicer of Unknown and Kathryn Moran of University of Victoria, and by
  University of Washington as part of NEPTUNE Canada: Wiring the Abyss 2012. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program.nnThe CTD data submitted by the originator
  represent the raw data suite. Processed versions of the data were generated by NODC.
  The ADCP data represent the raw and automated processed data set. Post processed
  quality assessed data are not available in this accession.\",\n\t\"license_title\":
